import React, { Component } from 'react';
import jsPDF from 'jspdf'
import Navbar from '../Navbar';
import Button from '@material-ui/core/Button';

class Pdf extends Component {
    constructor(props){
        super(props);
        this.state = {
        rows: []
        }
    }

    jsPdfGenerator = () => {
        
        var doc = new jsPDF('p', 'pt');

        var imgData = "data:image/jpeg;base64,";
        doc.addImage(imgData, 'JPEG',0,0,600, 280)

        doc.setFontType('bold')
        // Fila, columna 
        doc.text(20, 280, 'Certificaciones UFM')

        doc.setFontType('normal')
        doc.text(40, 300, 'Fecha:')

        doc.setFontType('italic')
        doc.text(55, 320, '30/OCT/2019')

        doc.setFontType('normal')
        doc.text(40, 355, 'Hash del Archivo')

        doc.setFontType('italic')
        doc.text(55, 375, 'QmVaoUdyLHYAdvzdr9tLrQsKxaniuNNFYXzfLQZXqcdYt5')
        
        // Save the Data
        doc.save('Generated'.pdf)
    }


    render(){
        return(
            <div className="App">
                <Navbar />
                <button onClick={this.jsPdfGenerator} type="primary"> Generar PDF </button> 
            </div>
        );
    }
}

export default Pdf